import React from "react";
import { Route,Routes } from "react-router-dom";
import AdashBoard from "./admin/aDashBoard";
import Nav from "./common/navBar";








const AdminApp =()=>{

    return(
        <>
        <div>
            <Routes>
           <Route exact path={'/aDash'} element={<AdashBoard/>}/>
            </Routes>    
        <Nav/>
        
            
           {/* <Fpage/> */}
         
            
    
            
        </div>
        </>
    )

}
export default AdminApp;
